        StringBuilder stringBuilder = new StringBuilder("SELECT ");
            stringBuilder.append("pessoa_.NM_PESSOA AS NOME_PESSOA, ");
            stringBuilder.append("publico_.ID_IDENTIFICADOR_REGISTRADO AS IDENTIFICADOR_REGISTRADO, ");
            stringBuilder.append("questionario_.NM_QUESTIONARIO AS NOME_QUESTIONARIO, ");
            stringBuilder.append("questionario_.SG_QUESTIONARIO AS SIGLA_QUESTIONARIO, ");
            stringBuilder.append("tipo_publico_.NM_TIPO_PUBLICO_ALVO AS TIPO_PUBLICO_ALVO, ");
            stringBuilder.append("identificador_registrado_.DS_IDENTIFICADOR_REGISTRADO AS DS_IDENTIFICADOR_REGISTRADO, ");
            stringBuilder.append("correio_eletronico_.DS_CORREIO_ELETRONICO AS CORREIO_ELETRONICO, ");
            stringBuilder.append("publico_alvo_.TP_IDENTIFICACAO_PUBLICO AS IDENTIFICACAO_PUBLICO, ");
            stringBuilder.append("CASE WHEN (SELECT COUNT(*) FROM QUESTIONARIO.RESPOSTA resposta_ WHERE resposta_.ID_PREENCHIMENTO = preenchimento_.ID_PREENCHIMENTO) > 1 THEN 'Sim' ELSE 'Não' END AS IS_QUESTIONARIO_RESPONDIDO ");
            stringBuilder.append("FROM QUESTIONARIO.PREENCHIMENTO preenchimento_ ");
            stringBuilder.append("INNER JOIN QUESTIONARIO.QUESTIONARIO questionario_ ON questionario_.ID_QUESTIONARIO = preenchimento_.ID_QUESTIONARIO ");
            stringBuilder.append("INNER JOIN CORPORATIVO.PESSOA pessoa_ ON pessoa_.ID_PESSOA = preenchimento_.ID_PESSOA ");
            stringBuilder.append("LEFT JOIN QUESTIONARIO.PUBLICO publico_ ON publico_.ID_PUBLICO = preenchimento_.ID_PUBLICO ");
            stringBuilder.append("INNER JOIN CORPORATIVO.CORREIO_ELETRONICO correio_eletronico_ ON correio_eletronico_.ID_CORREIO_ELETRONICO = publico_.ID_CORREIO_ELETRONICO ");
            stringBuilder.append("INNER JOIN CORPORATIVO.IDENTIFICADOR_REGISTRADO identificador_registrado_ ON identificador_registrado_.ID_IDENTIFICADOR_REGISTRADO = publico_.ID_IDENTIFICADOR_REGISTRADO ");
            stringBuilder.append("INNER JOIN QUESTIONARIO.PUBLICACAO publicacao_ ON publicacao_.ID_QUESTIONARIO = questionario_.ID_QUESTIONARIO ");
            stringBuilder.append("INNER JOIN QUESTIONARIO.DETALHE_PUBLICACAO detalhe_ ON detalhe_.ID_PUBLICACAO = publicacao_.ID_PUBLICACAO ");
            stringBuilder.append("INNER JOIN QUESTIONARIO.PUBLICO_ALVO publico_alvo_ ON publico_alvo_.ID_PUBLICO_ALVO = DETALHE_.ID_PUBLICO_ALVO ");
            stringBuilder.append("LEFT JOIN QUESTIONARIO.TIPO_PUBLICO_ALVO tipo_publico_ ON tipo_publico_.ID_TIPO_PUBLICO_ALVO = publico_alvo_.ID_TIPO_PUBLICO_ALVO ");
            stringBuilder.append("WHERE questionario_.SG_QUESTIONARIO = 'QC' ");

            if (filtro.getAno() != null && !filtro.getAno().isEmpty()) {
                stringBuilder.append("AND TO_CHAR(publicacao_.DT_PUBLICACAO, 'YYYY') = :ano ");
            }

            if (filtro.getSituacao() != null && !filtro.getSituacao().isEmpty()) {
                stringBuilder.append("AND questionario_.TP_SITUACAO = :situacao ");
            }

            if (filtro.getDataInicio() != null && filtro.getDataFim() != null) {
                stringBuilder.append("AND EXISTS ( ")
                .append("SELECT questionario_.ID_QUESTIONARIO ")
                .append("FROM QUESTIONARIO.PUBLICACAO publicacao_exists_ ")
                .append("WHERE QUESTIONARIO_.ID_QUESTIONARIO = publicacao_exists_.ID_QUESTIONARIO ")
                .append("AND publicacao_exists_.DT_INICIO BETWEEN :dataInicio AND :dataFim ")
                .append("AND publicacao_exists_.DT_FIM BETWEEN :dataInicio AND :dataFim ")
                .append(") ");
            }

            if (filtro.getQuestionario()!= null && !filtro.getQuestionario().isEmpty()) {
                stringBuilder.append(" AND questionario_.NM_QUESTIONARIO LIKE :questionario ");
            }

//          stringBuilder.append("GROUP BY ");
