package br.com.plataformalancamentofinanceiro.enumeration;

public enum TipoGerenciadorPessoaEnumeration {

	PESSOA_FISICA(1, "Pessoa Física"),
	PESSOA_JURIDICA(2, "Pessoa Jurídica"),
	PESSOA_AUTORIDADE(3, "Pessoa Autoridade"),
	PESSOA_SISTEMA(4, "Pessoa do Sistema");

	private Integer codigo;
	private String nome;

	private TipoGerenciadorPessoaEnumeration(Integer codigo, String nome) {
		this.codigo = codigo;
		this.nome = nome;
	}

	public Integer getCodigo() {
		return codigo;
	}

	public void setCodigo(Integer codigo) {
		this.codigo = codigo;
	}

	public String getNome() {
		return nome;
	}

	public void setNome(String nome) {
		this.nome = nome;
	}

}

