	@SuppressWarnings("unchecked")
	public boolean isVerificarVinculoOrganizacionalQuestionario(Long idUnidadeOrganizacional) {
		StringBuilder stringBuilder = new StringBuilder("SELECT DISTINCT vinculo_organizacional_ ")
			.append("FROM VinculoOrganizacional vinculo_organizacional_ ")
			.append("WHERE vinculo_organizacional_.unidadeOrganizacional.id = :codigoUnidadeOrganizacional ");
		Query query = entityManager.createQuery(stringBuilder.toString());
			query.setParameter("codigoUnidadeOrganizacional", idUnidadeOrganizacional);
		List<VinculoOrganizacional> vinculoOrganizacionalListResult = query.getResultList();
		if(vinculoOrganizacionalListResult.size() == 0) {
			return true;
		}
		return false;
	}
