@SuppressWarnings("unchecked")
	public List<UnidadeOrganizacional> consultarUnidadeOrganizacional() {
		StringBuilder stringBuilder = new StringBuilder("SELECT vinculo_organizacional_ ")
			.append("FROM VinculoOrganizacional vinculo_organizacional_ ")
			.append("RIGHT JOIN UnidadeOrganizacional unidade_organizacional_ ")
			.append("ON vinculo_organizacional_.unidade_organizacional_.id ")
			.append("WHERE unidade_organizacional_.situacao = :situacaoUnidadeOrganizacional ")
			.append("AND vinculo_organizacional_.id is null ")
			.append("ORDER BY unidade_organizacional_.id ASC ");
		Query query = entityManager.createQuery(stringBuilder.toString());
			query.setParameter("situacaoUnidadeOrganizacional", "A");
		return query.getResultList();
	}


