	private String descricaoTransacao;

	private String codigoCasoUso;

	private TransacoesPermitidas(String descricaoTransacao, String codigoCasoUso) {
		this.descricaoTransacao = descricaoTransacao;
		this.codigoCasoUso = codigoCasoUso;
	}

	public String getDescricaoTransacao() {
		return descricaoTransacao;
	}

	public void setDescricaoTransacao(String descricaoTransacao) {
		this.descricaoTransacao = descricaoTransacao;
	}

	public String getCodigoCasoUso() {
		return codigoCasoUso;
	}

	public void setCodigoCasoUso(String codigoCasoUso) {
		this.codigoCasoUso = codigoCasoUso;
	}

	public static boolean temPermissao(Transacao transacao, CasoUso casoUso) {
		for (TransacoesPermitidas permitida : TransacoesPermitidas.values()) {
			if (permitida.descricaoTransacao.equals(transacao.getDescricao())
					&& permitida.codigoCasoUso.equals(casoUso.getCodigoCasoUso())) {
				return true;
			}
		}
		return false;
	}

	/**
	 * Verifica se o código do caso de uso e a descrição da transação está
	 * cadastrada no enum.
	 *
	 * @param codigoCasoUso
	 * @param descricaoTransacao
	 * @return boolean
	 */
	public static boolean isTransacaoCadastrada(String descricaoTransacao, String codigoCasoUso) {
		for (TransacoesPermitidas permitida : TransacoesPermitidas.values()) {
			if (permitida.descricaoTransacao.equals(descricaoTransacao)
					&& permitida.codigoCasoUso.equals(codigoCasoUso)) {
				return true;
			}
		}
		return false;
	}

