    @SuppressWarnings("unchecked")
	public List<Questionario> recuperarQuestionarioVinculoOrganizacionalFiltro(Long idPessoa) {
		StringBuilder stringBuilder = new StringBuilder("SELECT questionario_ ")
			.append("FROM VinculoQuestionario vinculo_questionario_ ")
			.append("INNER JOIN vinculo_questionario_.vinculoOrganizacional vinculo_organizacional_ ")
			.append("INNER JOIN vinculo_questionario_.questionario questionario_ ")
			.append(" ");
		Query queryQuestionario = entityManager.createQuery(stringBuilder.toString());
//			query.setParameter("idPessoa", idPessoa);
		return queryQuestionario.getResultList();
	}

