    // FIXME [REDMINE-13073] {A} -- "Configurar Vinculo Organizacional na funcionalida de Monitoramento"
	@SuppressWarnings("unchecked")
	private List<VinculoQuestionario> configurarQuestionario(Query query) {
		VinculoQuestionarioDTO vinculoQuestionarioDTO = new VinculoQuestionarioDTO();
		List<VinculoQuestionario> vinculoQuestionarioList = new ArrayList<>();
		List<Object[]> queryResult = query.getResultList();
		List<Questionario> questionarioList = new ArrayList<>();
		for (Object[] resultado : queryResult) {
			Questionario questionario = new Questionario();
			questionario.setId(new BigDecimal(resultado[0].toString()).longValue());
			questionario.setNome(resultado[1].toString());
			questionario.setIdTipoDocumentoExigivel(null); // new BigDecimal(resultado[2].toString()).longValue()
			questionario.setFinalidade(null); // resultado[3].toString()
			questionario.setUsuarioUltimaAlteracao(resultado[4].toString());
			questionario.setSigla(resultado[5].toString());
			questionario.setSituacao(null);
			questionario.setIdAplicacao(null); // new BigDecimal(resultado[7].toString()).longValue()
			questionarioList.add(questionario);
		}
		vinculoQuestionarioDTO.setQuestionarioList(questionarioList);
		vinculoQuestionarioDTO.setVinculoQuestionarioList(vinculoQuestionarioList);
		return questionarioList;
	}

