	private Boolean validarIdentificadorRegistrado(String indentificadorRegistrado) {
		Pattern pattern = Pattern.compile("0{9}|1{9}|2{9}|3{9}|4{9}|5{9}|6{9}|7{9}|8{9}|9{9}");
		Matcher matcher = pattern.matcher(indentificadorRegistrado);
		if (indentificadorRegistrado.matches("[0-9]*") && indentificadorRegistrado.length() == 11) {
			if(matcher.find()) {
				return false;
			}
			int soma = 0;
			for (int i = 0; i < 9; i++) {
				soma = soma + parseInt(indentificadorRegistrado.charAt(i)) * (10 - i);
			}
			int dv1 = 11 - (soma % 11);
			if (dv1 == 10 || dv1 == 11) {
				dv1 = 0;
			}
			if (dv1 != parseInt(indentificadorRegistrado.charAt(9))) {
				return false;
			}
			soma = 0;
			for (int i = 0; i < 9; i++) {
				soma = soma + parseInt(indentificadorRegistrado.charAt(i)) * (11 - i);
			}
			soma = soma + dv1 * 2;
			int dv2 = 11 - (soma % 11);
			if (dv2 == 10 || dv2 == 11) {
				dv2 = 0;
			}
			if (dv2 != parseInt(indentificadorRegistrado.charAt(10))) {
				return false;
			}
			return true;
		}
		return false;
	}

	private int parseInt(Character c) {
		return Integer.parseInt(c.toString());
	}

