	// FIXME [REDMINE-14107] [02] {A} -- "Criar novo e-mail principal para um determinado usuário"
	private CorreioEletronico recuperarCorreioEletronicoPerfilPessoa(PerfilPessoa perfilPessoa) {
		CadastroPessoas cadastroPessoas = repositorioPublico.getCadastroPessoaService();
		PessoaFisica pessoaFisica = cadastroPessoas.getServicoPessoas().recuperarPessoaFisicaConsultandoReceita(perfilPessoa.getIdentificadorRegistrado().getDescricao());
		List<Email> emailPessoaList = cadastroPessoas.getServicoEmails().listarEmailsDaPessoa(pessoaFisica);
		if(emailPessoaList.stream().filter(email -> email.getEmail().equals(perfilPessoa.getCorreioEletronico().getDescricaoCorreioEletronico())).findAny().orElse(null) != null) {
			perfilPessoa.setCorreioEletronico(recuperarCorreioEletronico(perfilPessoa.getCorreioEletronico().getDescricaoCorreioEletronico(), perfilPessoa.getIdentificadorRegistrado().getPessoa().getId()));
		} else {
			perfilPessoa.setCorreioEletronico(criarCorreioEletronicoPrincipal(perfilPessoa, cadastroPessoas, pessoaFisica));
		}
		return perfilPessoa.getCorreioEletronico();
	}

	// FIXME [REDMINE-14107] [02] {A} -- "Criar novo e-mail principal para um determinado usuário"
	private CorreioEletronico criarCorreioEletronicoPrincipal(PerfilPessoa perfilPessoa, CadastroPessoas cadastroPessoas, PessoaFisica pessoaFisica) {
		List<Email> listarEmailsDaPessoa = cadastroPessoas.getServicoEmails().listarEmailsDaPessoa(pessoaFisica);
		Email emailPrincipal = listarEmailsDaPessoa.stream().filter(email -> email.getFinalidadePrincipal()).findAny().orElse(null);
		if(emailPrincipal != null) {
			emailPrincipal.setFinalidadePrincipal(false);
			emailPrincipal.setDataUltimaAlteracao(new LocalDateTime(DateTimeUtils.currentTimeMillis(), ISOChronology.getInstance()));
			emailPrincipal.setUsuarioUltimaAlteracao(recuperarUsuarioLogado().getLogin());
			cadastroPessoas = repositorioPublico.getCadastroPessoaService();
			repositorioPublico.salvarNovoEmail(emailPrincipal);
		}
//		for(Email emailResposta : listarEmailsDaPessoa) {
//			if(emailResposta.getFinalidadeEndereco().getId().equals(5L)) {
//				emailResposta.setFinalidadePrincipal(false);
//				emailResposta.setDataUltimaAlteracao(LocalDateTime.now());
//				emailResposta.setUsuarioUltimaAlteracao(autorizadorSeguranca.getUsuarioLogado().getLogin());
//				repositorioPublico.salvarNovoEmail(emailResposta);
//			}
//		}
		emailPrincipal = repositorioPublico.criarNovoEmailPrincipal(perfilPessoa.getCorreioEletronico().getDescricaoCorreioEletronico(), perfilPessoa.getIdentificadorRegistrado().getDescricao(), cadastroPessoas, recuperarUsuarioLogado().getLogin());
		emailPrincipal.setFinalidadePrincipal(true);
		emailPrincipal.setDataUltimaAlteracao(LocalDateTime.now());
		emailPrincipal.setUsuarioUltimaAlteracao(autorizadorSeguranca.getUsuarioLogado().getLogin());
		return new CorreioEletronico(repositorioPublico.salvarNovoEmail(emailPrincipal));
	}

