public int salvarSituacaoNotificacao(NotificacaoPessoa notificacao){
		final String JNDI_QUESTIONARIO = "java:jboss/datasources/QuestionarioDS";

		String query = "UPDATE QUESTIONARIO.NOTIFICACAO_PESSOA SET ID_SITUACAO_OPERACAO = ? WHERE ID_NOTIFICACAO_PESSOA = ?";

		int retorno = 0;
		Context ctx;
		try {
			ctx = new InitialContext();
			DataSource dsOrigem = (DataSource) ctx.lookup(JNDI_QUESTIONARIO);
			try(Connection conn = dsOrigem.getConnection()){
				if (conn != null) {
					System.out.println("Conexão estabelecida.");
					try(PreparedStatement ps = conn.prepareStatement(query)){
						ps.setString(1, notificacao.getSituacaoOperacao().getId().toString());
						ps.setLong(2, notificacao.getId());
						retorno = ps.executeUpdate();
						if(retorno <= 0){
							System.out.println("Não foi possível salvar a notificacao " + notificacao.getId());
						}
					}
				}
			}
		} catch (NamingException e) {
			LOGGER.error("Ocorreu na execução da query.");
			LOGGER.error(e, e);
			retorno = -1;
		} catch (SQLException e) {
			LOGGER.error("Ocorreu na execução da query.");
			LOGGER.error(e, e);
			retorno = -1;
		}finally {
			LOGGER.info("Tarefa finalizada.");
		}
		return retorno;
	}
