public List<Publico> consultarPublicoPorSqlFonteDados(FonteDados fonteDados){

		List<Publico> retorno = new ArrayList<>();

		Connection conn = null;
		PreparedStatement ps = null;
		Context ctx;

		try {

			ctx = new InitialContext();
			DataSource dsOrigem = (DataSource) ctx.lookup(fonteDados.getConexao().getJndi());
			conn = dsOrigem.getConnection();
			ps = conn.prepareStatement(fonteDados.getDescricaoFonteSql());
			ResultSet rs = ps.executeQuery();

			while (rs.next()) {

				String cpf = rs.getString(1);
				String nome = rs.getString(2);
				String email = rs.getString(3);

				retorno.add(new Publico(cpf, nome, email));

			}

		} catch (NamingException e) {
			LOGGER.error("Validação com erro para conexão '" + "' e query '" + "'.");
			LOGGER.error(e, e);
		} catch (SQLException e) {
			LOGGER.error("Validação com erro para conexão '" + "' e query '" + "'.");
			LOGGER.error(e, e);
		} finally {
			try {
				if (ps != null) {
					ps.close();
				}
				if (conn != null) {
					conn.close();
				}
			} catch (SQLException e) {
				LOGGER.error(e, e);
			}
		}

		return retorno;
	}
