public Integer consultaQtdResultadoSqlCpf(Long id, String cpf) {

		final String[] camposASeremProjetados = ParametroConsulta.quebrarCamposProjecao("");
		FonteDados fonteDados = buscarEmEspecifico(id, camposASeremProjetados);

		Connection conn = null;
		PreparedStatement ps = null;

		try {

			Context ctx = new InitialContext();
			DataSource dsOrigem = (DataSource) ctx.lookup(fonteDados.getConexao().getJndi());

			conn = dsOrigem.getConnection();

			StringBuilder sb = new StringBuilder();

			sb.append("SELECT count(*) FROM ( ");
			sb.append(fonteDados.getDescricaoFonteSql());
			sb.append(")");

			ps = conn.prepareStatement(sb.toString());
			ps.setString(1, cpf);

			ResultSet rs = ps.executeQuery();

			Integer qnt = 0;

			if (rs.next()) {
				qnt = Integer.valueOf(rs.getInt(1));
			}


			return qnt;

		} catch (SQLException e) {
			LOGGER.error(e, e);
		} catch (Exception e) {
			LOGGER.error(e, e);
		} finally {
			try {
				if (ps != null) {
					ps.close();
				}
				if (conn != null) {
					conn.close();
				}
			} catch (SQLException e) {
				LOGGER.error(e, e);
			}
		}

		return 0;
	}
