	public Integer cadastrarPublicoAlvoFonteDados(Publico publico) {

		List<Publico> publicoList = new ArrayList<>();

		long tempoInicial = System.currentTimeMillis();

		Connection conn = null;
		PreparedStatement preparedStatement = null;
		Context ctx;
		try {
			ctx = new InitialContext();
			DataSource dsOrigem = (DataSource) ctx.lookup(publico.getFonteDados().getConexao().getJndi());
			conn = dsOrigem.getConnection();
			preparedStatement = conn.prepareStatement(publico.getFonteDados().getDescricaoFonteSql());
			ResultSet rs = preparedStatement.executeQuery();
			while (rs.next()) {

				String cpf = rs.getString(1);
				String nome = rs.getString(2);
				String email = rs.getString(3);

				StringBuilder stringBuilder = new StringBuilder("INSERT INTO QUESTIONARIO.PUBLICO "
					+ "(ID_PUBLICO_ALVO, ID_PESSOA, ID_IDENTIFICADOR_REGISTRADO, "
					+ "ID_CORREIO_ELETRONICO, DS_USUARIO_ULTIMA_ALTERACAO, DH_ULTIMA_ALTERACAO, "
					+ "IN_ENVIO_IDENTIFICACAO, DH_LOGIN_INICIAL, DH_ULTIMO_LOGIN) "
					+ "VALUES(?, ?, ?, ?, ?, ?, ?, ?, ?) ");

				preparedStatement.setLong(1, publico.getPublicoAlvo().getId());
				preparedStatement.setLong(2, publico.getPessoa().getId());

				publicoList.add(new Publico(cpf, nome, email));

			}
		} catch (NamingException e) {
			LOGGER.error("Validação com erro para conexão '" + "' e query '" + "'.");
			LOGGER.error(e, e);
		} catch (SQLException e) {
			LOGGER.error("Validação com erro para conexão '" + "' e query '" + "'.");
			LOGGER.error(e, e);
		} finally {
			try {
				if (preparedStatement != null) {
					preparedStatement.close();
				}
				if (conn != null) {
					conn.close();
				}
			} catch (SQLException e) {
				LOGGER.error(e, e);
			}
		}

		 long tempoFinal = System.currentTimeMillis();

		System.out.println("QUANTIDADE PROCESSADA: " + publicoList.size());
		System.out.printf("TEMPO DE PROCESSAMENTO: %.3f ms%n", (tempoFinal - tempoInicial) / 1000d);

		return 1;
	}
